  I THOMSON, Malcolm WilŤiam (Bill) and BENNETT, Lyndon
  01> THOMSON, Malcolm William (Bill) m on 09.01.1965 to BENNETT, Lyndon
  b 20.06.1942
  b 03.06.1943
  Bill 6. at Christchurch. Lyndon, d/o CD Bennett and VEE Crosse. Address: Ramarua, RD, Norsewood.
  Bill lived in Hastings from the age of 312 and Hereworth School (1952-55), Wanganui Collegiate School
  (1956-59) and Lincoln College (1960-62). After his marriage to Lyndon, they moved to their present
  address, a farm which they first managed and then leased from the family. In 1973 they bought the
  family out.
  Lyndon is a trained teacher and did some part-time teaching at Norsewood School during some of their
  early married years, until family commitments became a priority. Later she took a more active role in
  the farm, particularly in the planning and financial management. She also initiated a speakers' forum
  where local women could socialise.
  Bill was a member of the Norsewood School Committee for ten years, four of them as chairman. More
  recently he spent six years as the elected member for Norsewood on the Dannevirke Community Board. His
  interests have included fishing, diving, tramping and power-boat racing.
  01> THOMSON, Michael Charles m on 05.12.1992 to DUFFY, Christina Mary
  b 20.05.1967
  b 15.12.1965
  Michael b. at Hastings and m. at Taupo. Christina, d/o John Percy Duffy and Janice Amy Drysdale,
  b. at Eketahuna. Address: 2 Kempton Place, Taupo.
  Michael lived at Norsewood until 1991, and was educated at Te Aute College (1980-82) and Dannevirke
  High School (1983). He then worked for a Mitsubishi garage in Dannevirke where he started his
  apprenticeship in 1983.
  Christina lived at Eketahuna until 1987 and went to Solway College in Masterton (1979-82). She
  then worked at the Mitsubishi garage in Pahiatua as an office junior. After six months she was
  promoted to office senior and 1987 she was transferred to Dannevirke when the head office of the
  garage was moved there.
  Michael and Christina worked in Dannevirke until 1991 when they both moved to Taupo and worked in
  the Mitsubishi garage there until the opened their own garage in Taupo in 1993. Michael runs the
  workshop and Christina, in between looking after the children, does the bookkeeping.
  01> THOMSON, Gene Michael
  b 02.08.1994
  Gene b. at Rotorua.
  02> THOMSON, Tania Maire
  b 17.01.1998
  Tania b. at Rotorua.
  02> THOMSON, Elizabeth Kate m on 10.03.1990 to SMYTH, Christopher
  b 07.02.1969
  b 31.07.1963
  Christopher, s/o Harley James Smyth and Elizabeth Rosemary Russell. Address: Atrig Station, RD 10,
  Dannevirke; Email: atrigstn@clear.net.nz.
  Kate works for an accountant, looks after the books for the farm, and enjoys theatre work both on
  and off the stage.
  Kate went to Iona College in Havelock North then to teachers' college for two years before deciding
  to follow an interest in computers. She went to polytech then joined an accounting firm, working
  for four years before having her first child. Five years later she started work for another
  accountant.
  Chris is also descended from William Nelson, but from his first marriage. He was educated at Motea
  School and Rathkeale College in Masterton, He started his farming career working for a neighbour
  in 1980 then worked at the freezing works for two years before returning to work on the family
  farm. Kate and Christopher took up a lease on the family farm of 472 hectares in 1995.
  Chris is interested in all motorsports and races motorbikes.
